import React from 'react';
import classes from"./Header.module.css";

const Header = () => {
    return (
        <header className={classes.header}>
            <img src="https://sun9-37.userapi.com/c628321/v628321677/3bc35/Nw-jx5UJK5k.jpg  " alt="logo"></img>
        </header>
    );
}

export default Header;
